import axios from "axios";

export async function Get(url, params) {
    try {
        await axios.get(url, { params }).then((data) => {
            if (data && data.status === 200)
                return data.data;
        })
    }
    catch (e) {
        callback(e);
    }
}

export async function Post(url, obj, callback) {
    try {
        axios.post(url, obj).then((data) => {
            if (data && data.status === 200)
                callback(data.data);
        })
    }
    catch (e) {
        callback(e);
    }
}
